Материал стоматологический слепочный Repin 	Цинкоксидная, эвенгальная паста белого и оранжевого цвета. При перемешивании получается пластичная безусадочная масса. Применяется при снятии слепков с беззубых челюстей. Дает точный отпечаток слизистой, быстро затвердевает, становится твердой и хрупкой. С успехом применяется для временной фиксации несъемных протезов. В состав входят компоненты: окись цинка, эвгенол, наполнители, ускоритель структурирования, канифоль, бальзам для ослабления раздражающего действия эвгенола, пластификатор и красители. Ускорители- ацетат цинка. Наполнители- тальк, каолин, мел. Пластификатор- вазелиновое масло. Коррегирующее вещество- мятное масло. Белая паста 300 гр. Коричневая паста 125 гр.
